const axios = require("axios");

module.exports = {
  config: { name: "bard", version: "1.0", author: "Samir OE", countDown: 5, role: 0, category: "Bard" },
  
  onStart: async ({ message: msg, event: evt, args: a, commandName: cmd }) => {
    const cookies = "g.a000pAjfCSxaGzWv57f6MDmckX4G9uorq_w-yPJ7iwkjTny0OOEpIETxiko5lq98kJitCCXfFgACgYKASoSARISFQHGX2MiPcW2WPZnEbh96mXRSS-OFxoVAUF8yKrj7DuqZwFE13Jg0UI_eRtm0076";
    try {
      const { data } = await axios.get(`https://www.samirxpikachu.run.place/gemini-apu?text=${encodeURIComponent(a.join(' '))}&cookies=${cookies}`);
      let attachments = data.images?.length ? await Promise.all(data.images.map(img => global.utils.getStreamFromURL(img))) : null;
      msg.reply({ body: data.text, attachment: attachments }, (err, info) => {
        global.GoatBot.onReply.set(info.messageID, { cmd, messageID: info.messageID, author: evt.senderID });
      });
    } catch (err) {
      console.error("Error:", err.message);
    }
  },

  onReply: async ({ message: msg, event: evt, Reply: rp, args: a }) => {
    const cookies = "g.a000pAjfCSxaGzWv57f6MDmckX4G9uorq_w-yPJ7iwkjTny0OOEpIETxiko5lq98kJitCCXfFgACgYKASoSARISFQHGX2MiPcW2WPZnEbh96mXRSS-OFxoVAUF8yKrj7DuqZwFE13Jg0UI_eRtm0076";
    if (evt.senderID !== rp.author) return;
    const cmd = rp.commandName;
    try {
      const { data } = await axios.get(`https://www.samirxpikachu.run.place/gemini-apu?text=${encodeURIComponent(a.join(' '))}&cookies=${cookies}`);
      let attachments = data.images?.length ? await Promise.all(data.images.map(img => global.utils.getStreamFromURL(img))) : null;
      msg.reply({ body: data.text, attachment: attachments }, (err, info) => {
        global.GoatBot.onReply.set(info.messageID, { cmd, messageID: info.messageID, author: evt.senderID });
      });
    } catch (err) {
      console.error("Error:", err.message);
    }
  }
};
